import './App.css';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Home from './Components/Home';
import Shop from './Components/Shop';
import Regester from './Components/Register';

function App() {
  return (
    <Router>
      <Routes>
        <Home />
        <Shop />
        <Regester />
      </Routes>
    </Router>

  );
}

export default App;
